import React from "react";
import human from "../../../Image/human.jpg";
import "./Profil.css";
import ListProfile from "./ListProfile";

class Profil extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="wrapp">
          <div class="btn-group">
    <button type="button" class="btn btn-default dropdown-toggle" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
      <img src="http://lorempixel.com/75/50/abstract/"/>
      0123 4567 8912 3456
      <span class="glyphicon glyphicon-chevron-down"></span>
    </button>

    <ul class="dropdown-menu">
      <li class="dropdown-header">Member name (you)</li>
      <li>
        <a href="#" title="Select this card"><img src="http://lorempixel.com/75/50/abstract/"/>0123 4567 8912 3456</a>
      </li>
      <li>
        <a href="#" title="Select this card"><img src="http://lorempixel.com/75/50/abstract/"/>0123 4567 8912 3456</a>
      </li>
      <li class="dropdown-header">Member name</li>
      <li>
        <a href="#" title="Select this card"><img src="http://lorempixel.com/75/50/abstract/"/>>0123 4567 8912 3456</a>
      </li>
    </ul>
  </div>
        {/* <nav class="navbar profile">
          <a class="navbar-brand" href="##">
            <img className="image-profile" src={human} width="50" height="50" alt="" />
          </a>
          <div className="navbar-nav">
            <i className="fa fa-bars icon"
            style={{fontSize: "25px"}}
            ></i>
          </div>
        </nav> */}
        <div class="form-group has-search">
          <span class="fa fa-search form-control-feedback"></span>
          <input
            type="text"
            class="form-control shadow-none"
            placeholder="Search Your Contact . . ."
          />
        </div>
        <div className="list-profile">
          <ListProfile />
        </div>
      </div>
    );
  }
}

export default Profil;
